"use strict";
function parsePinCode(inputString) {
    var instructions = inputString.split('\n');
    var numpad = [[1, 2, 3],
        [4, 5, 6],
        [7, 8, 9]];
    var currentPosition = [1, 1];
    var code = [];
    for (var i = 0; i < instructions.length; i++) {
        var instruction = instructions[i];
        for (var j = 0; j < instruction.length; j++) {
            var direction = instruction.charAt(j);
            move(currentPosition, direction);
        }
        code.push(numpad[currentPosition[1]][currentPosition[0]]);
    }
    return parseInt(code.join(''));
}
exports.parsePinCode = parsePinCode;
function move(position, direction) {
    switch (direction) {
        case 'U':
            if (position[1] > 0)
                position[1]--;
            break;
        case 'D':
            if (position[1] < 2)
                position[1]++;
            break;
        case 'L':
            if (position[0] > 0)
                position[0]--;
            break;
        case 'R':
            if (position[0] < 2)
                position[0]++;
            break;
    }
}
var input = "\\\\";
console.log('The pin code is', parsePinCode(input));
